using System;
using System.Security.Cryptography;

namespace VaslD.Utility.Cryptography
{
    public static class Program
    {
        public static void Main()
        {
            var password = Guid.NewGuid().ToString("N");

            using var rng = RandomNumberGenerator.Create();
            var salt = new byte[256 / 8];
            rng.GetBytes(salt);

            using var cipher = new PasswordCipher(password, salt);
            Console.WriteLine($"Generated Text Password: {cipher.Password}");
            Console.WriteLine($"Generated Key Bytes:     {cipher.Salt}");
            Console.WriteLine();

            Console.WriteLine("[ Short String Tests ]");
            const string text = "Text and 测试。";
            var simpleOne = cipher.EncryptTextOnce(text);
            var simpleTwo = cipher.EncryptTextOnce(text);
            var simpleThree = cipher.DecryptTextOnce(simpleOne);
            Console.WriteLine($"Check 1: {(simpleOne == simpleTwo ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 2: {(simpleThree == text ? "Pass" : "Fail")}");

            var runningOne = cipher.EncryptContinuousText(text);
            var runningTwo = cipher.EncryptContinuousText(text);
            Console.WriteLine($"Check 3: {(simpleOne != runningOne ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 4: {(runningOne != runningTwo ? "Pass" : "Fail")}");

            var decryptOne = cipher.DecryptContinuousText(runningOne);
            var decryptTwo = cipher.DecryptContinuousText(runningTwo);
            Console.WriteLine($"Check 5: {(decryptOne == text ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 6: {(decryptTwo == text ? "Pass" : "Fail")}");
            Console.WriteLine();

            Console.WriteLine("[ Long String Tests ]");
            const string longText = "";
            simpleOne = cipher.EncryptTextOnce(longText);
            simpleTwo = cipher.EncryptTextOnce(longText);
            simpleThree = cipher.DecryptTextOnce(simpleOne);
            Console.WriteLine($"Check 1: {(simpleOne == simpleTwo ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 2: {(simpleThree == longText ? "Pass" : "Fail")}");

            runningOne = cipher.EncryptContinuousText(longText);
            runningTwo = cipher.EncryptContinuousText(longText);
            Console.WriteLine($"Check 3: {(simpleOne != runningOne ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 4: {(runningOne != runningTwo ? "Pass" : "Fail")}");

            decryptOne = cipher.DecryptContinuousText(runningOne);
            decryptTwo = cipher.DecryptContinuousText(runningTwo);
            Console.WriteLine($"Check 5: {(decryptOne == longText ? "Pass" : "Fail")}");
            Console.WriteLine($"Check 6: {(decryptTwo == longText ? "Pass" : "Fail")}");
        }
    }
}
